{
	int s = u->s;
	int h = h0[s][a];
	int w = w0[s][a];

	int dx[4] = { 0, 1, 0,-1};
	int dy[4] = { 1, 0,-1, 0};

	int count = 0;
	int total = 0;
	for (int x = -1; x <= w; ++x)
	{
		int nx = bx + x;
		for (int y = -1; y <= h; ++y)
		{
			int ny = by + y;
			if (0 <= x && x < w && 0 <= y && y < h && piece[s][a][y][x] == '#')
			{
				if (field[ny][nx] != '.')
					return -100.0;
			}
			else // piece[s][a][y][x] == '.' ?
			{
				int i;
				for (i = 0; i < 4; ++i)
				{
					int tx = x + dx[i], ty = y + dy[i];
					if (0 <= tx && tx < w && 0 <= ty && ty < h && piece[s][a][ty][tx] == '#')
						break;
				}

				if (i < 4)
				{
					total++;
					if (nx < 0 || W <= nx || ny < 0 || H <= ny || field[ny][nx] != '.')
						count++;
				}
			}
		}
	}

	return count * 100.0 / total;
}
